  <style>
    /* Fixed sidenav, full height */
.sidenav {
  height: 100%;
  width: 400px;
  position: fixed;
  z-index: 1;
  top: 0;
  left: 0;
  background-color: #111;
  overflow-x: hidden;
  padding-top: 20px;
}

#list {
    overflow-y: scroll;
    overflow-x: hidden;
    min-height: 0px;
    max-height: 250px;
}

/* Style the sidenav links and the dropdown button */
.sidenav a, .dropdown-btn, #searchbar, #list, .listItem, .button {
  padding: 6px 8px 6px 16px;
  text-decoration: none;
  font-size: 20px;
  color: #818181;
  display: block;
  border: none;
  background: none;
  width:100%;
  text-align: left;
  cursor: pointer;
  outline: none;
}

/* On mouse-over */
.sidenav a:hover, .dropdown-btn:hover {
  color: #f1f1f1;
}

/* Main content */
.main {
  margin-left: 200px; /* Same as the width of the sidenav */
  font-size: 20px; /* Increased text to enable scrolling */
  padding: 0px 10px;
}

/* Add an active class to the active dropdown button */
.active {
  background-color: grey;
  color: white;
}

/* Dropdown container (hidden by default). Optional: add a lighter background color and some left padding to change the design of the dropdown content */
.dropdown-container {
  display: none;
  background-color: #262626;
  padding-left: 8px;
}

/* Optional: Style the caret down icon */
.fa-caret-down {
  float: right;
  padding-right: 8px;
}

  </style>

<body>
    <script>
        function search() {
        let listContainer = document.getElementById('list');
        let listItems = document.getElementsByClassName('listItem');

        let input = document.getElementById('searchbar').value
        input = input.toLowerCase();

        let noResults = 0
          for (i = 0; i < listItems.length; i++) {
              if (!listItems[i].innerHTML.toLowerCase().includes(input) || input === "" ) {
                  listItems[i].style.display="none";
                  continue;
              }
              else {
                  listItems[i].style.display="flex";
                  noResults = noResults +1;
              }
          }
    }     
    </script>

<script type="module">
        import { ObjectLoader, Scene } from "three";
        import Stats from 'three/addons/libs/stats.module.js';
        import * as smblViz from "./js/loader.js";
        import * as ui from "./js/ui.js";

        let dropArea = document.getElementById('drop-sbml');
        let sblm_selection = document.getElementById('sbml_file');


        dropArea.addEventListener('drop', function(event) {
            console.log("drop");

            var reader = new FileReader();
            reader.onloadend = function() {
                var data = smblViz.load_sbml(this.result);
                console.log(data);
                window.data = data;
                Graph.graphData(data);
                
                let list = document.getElementById('list');
                list.replaceChildren();


                data.nodes.forEach((node) => {
                let a = document.createElement("a");
                a.innerText = node.id;
                a.style.display="none";
                a.classList.add("listItem");
                a.addEventListener("click", function() { ui.clickNode(a, Graph); });
                list.appendChild(a);
                })
            };

            reader.readAsText(event.dataTransfer.files[0]);
            event.preventDefault();
        })

        let fluxArea = document.getElementById('drop-flux');
        fluxArea.addEventListener('drop', function(event) {
            console.log("yay")

            var reader = new FileReader();
            reader.onloadend = function() {
                const flux = smblViz.load_flux_from_csv(this.result);
                const { nodes, links } = Graph.graphData();

                for (var i = 0; i < links.length; i++) {
                    var link = links[i];
                    var source = link.source;
                    var target = link.target;
                    var value = link.value;

                    if (source.id in flux) {
                        link.value = link.value * flux[source.id];
                        links[i] = link;

                    } else if (target.id in flux) {
                        link.value = link.value * flux[target.id];
                        links[i] = link;

                    } else {
                        console.warn(link)
                    }
                    
                } 

                Graph.graphData({ nodes, links });


            };

            reader.readAsText(event.dataTransfer.files[0]);
            event.preventDefault();
        })


          var dropdown = document.getElementsByClassName("dropdown-btn");
            var i;

            for (i = 0; i < dropdown.length; i++) {
              dropdown[i].addEventListener("click", function() {
                this.classList.toggle("active");
                var dropdownContent = this.nextElementSibling;
                if (dropdownContent.style.display === "block") {
                  dropdownContent.style.display = "none";
                } else {
                  dropdownContent.style.display = "block";
                }
              });
            }
    </script>

        var json = {}

        const highlightNodes = new Set();
        const highlightLinks = new Set();
        let hoverNode = null;
        let isRotationActive = false;

        const elem = document.getElementById('3d-graph');

        let list = document.getElementById('list');
        graph_data.nodes.forEach((node) => {
          let a = document.createElement("a");
          a.innerText = node.id;
          a.style.display="none";
          a.classList.add("listItem");
          a.addEventListener("click", function() { ui.clickNode(a, Graph); });
          list.appendChild(a);
        })
        
        function highlight(node) {
            if (highlightNodes.has(node.id)){
                highlightNodes.delete(node.id)

                if (highlightNodes.size == 0){
                    Graph.graphData().nodes.forEach( node => node.color = 'rgba(255,0,0,1)')
                } else {
                    node.color ='rgba(255,0,0,1)'
                }

                redraw_color()
                return
            }

            if (highlightNodes.size == 0){
                console.log("Set all to 0.1")
                Graph.graphData().nodes.forEach( node => node.color = 'rgba(255,0,0,0.3)')
            }

            highlightNodes.add(node.id)
            node.color = 'rgba(0,255,255,1)';
            node.links.forEach(link => highlightLinks.add(link))

            console.log(highlightNodes)
            redraw_color()

        }

        function redraw_color() {
            Graph
            .nodeColor(Graph.nodeColor())
            .linkWidth(Graph.linkWidth())
            .linkDirectionalParticles(Graph.linkDirectionalParticles());
        }

        var sphereGeometry = new THREE.SphereGeometry( 4, 3, 2 );
        let material = new THREE.MeshBasicMaterial({ color: 0xff0000 })

        var mesh = new THREE.InstancedMesh(sphereGeometry,material, 1 )
        console.log(mesh)

        var Graph = ForceGraph3D()(elem)
          .graphData(graph_data)
          .nodeThreeObject(mesh)
          .nodeLabel('id')
          .linkOpacity(1)
          .linkResolution(2)
          .nodeVisibility(node => node.group == 1)
          .linkAutoColorBy('value')
          .nodeColor(node => node.color)
          .linkWidth(link => highlightLinks.has(link.id) ? 4 : 1)
          .linkDirectionalParticles(link => highlightLinks.has(link) ? link.value : 0)
          .linkDirectionalParticleWidth(4)
          .onNodeClick(function(node){
            console.log(node)
              var node_data = document.getElementById('node_data');
              node_data.innerText = node.id;
              node_data.style.background  = "white";
              highlight(node);
          })
          .warmupTicks(100)
          .cooldownTicks(5)
        
        window.Graph = Graph;

        let isAnimationActive = true;
        document.getElementById('animationToggle').addEventListener('click', event => {
          console.log(isAnimationActive)
          isAnimationActive ? Graph.enableNodeDrag(false) : Graph.enableNodeDrag(true);
          Graph.refresh()

          isAnimationActive = !isAnimationActive;
          event.target.innerHTML = `${(isAnimationActive ? 'Disable' : 'Enable')} Drag`;
        });

        let ForceToggle = true;
        document.getElementById('ForceToggle').addEventListener('click', event => {

          ForceToggle ? Graph.cooldownTicks(0) : Graph.cooldownTicks(Infinity);
          Graph.refresh()

          ForceToggle = !ForceToggle;
          event.target.innerHTML = `${(ForceToggle ? 'Pause' : 'Resume')} Force`;
        });

        document.getElementById('Save').addEventListener('click', event => {
            var node_pos = {};
            
            Graph.graphData().nodes.forEach((node) => {
                var pos = {};
                pos.x = node.x;
                pos.y = node.y;
                pos.z = node.z;

                node_pos[node.id] = pos;
            })



          let save = JSON.stringify (node_pos);

          localStorage.setItem('graph', save);
        });

        document.getElementById('Clear').addEventListener('click', event => {
          Graph.scene().clear();
        });

        document.getElementById('Load').addEventListener('click', event => {
            const elem = document.getElementById('3d-graph');
            
            Graph = ForceGraph3D()(elem)
                .graphData(graph_data)

            let data = JSON.parse(localStorage.getItem('graph') );
            console.log(data);

            Graph.graphData().nodes.forEach((node) => {
                if (node.id in data) {
                    var pos = data[node.id];
                    node.x = pos.x;
                    node.y = pos.y;
                    node.z = pos.z;

                }
            })

        });

        const distance = 2000;
        let angle = 0;
        let rotate_id = 0;


        document.getElementById('rotationToggle').addEventListener('click', event => {

          if(isRotationActive) {
            isRotationActive = false;
            Graph.enableNavigationControls(true)
            clearInterval(rotate_id)
          } else {
            isRotationActive = true;
            Graph.enableNavigationControls(false)
            rotate_id = setInterval(() => {
                Graph.cameraPosition({
                  x: distance * Math.sin(angle),
                  z: distance * Math.cos(angle)
                });
                angle += Math.PI / 300;

            }, 10);
          }
          event.target.innerHTML = `${(isRotationActive ? 'Pause' : 'Resume')} Rotation`;
        });

  </script>
